import ScrollAnim from 'rc-scroll-anim';

const iniciaScroll = () => {
    ScrollAnim
    .scrollScreen
    .init({loop: false, duration: 1200, ease: "easeInOutQuart", scrollInterval: 800, toHeight: '100vh'});
}

export default iniciaScroll;
